import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";


function middleTop() {
  return (
        <div>
            <div className="row">
                <div className="col">
                            <h1>hello</h1>
                </div>
            </div>
        </div>      
  );
}

export default middleTop;
